import React from "react";
import PersonIcon from "@mui/icons-material/Person";
import contest from "../../static/contest.json"
import { NavLink } from "react-router-dom";

export default function Cards() {
  return (
    <>
      <div className=" grid grid-cols-1 md:grid-cols-2  lg:grid-cols-3 gap-0 " >
        {
          contest.map((contest) => (
            <div className=" flex justify-center items-center flex-col bg-purple-50 w-9/12 m-10 transition-shadow shadow-lg rounded-md" key={contest.id}>
          <img
            src={contest.image}
            alt=""
            className=" w-full h-80  rounded-ss-md rounded-se-md"
          />
          <div className=" flex flex-col justify-center items-center">
            <h1 className=" py-2 font-light">HACKATHONS</h1>
            <h1 className=" font-bold text-lg">{contest.contest}</h1>
            <div className=" flex justify-center items-center bg-purple-200 p-2 rounded-md my-2 border-black border">
              <PersonIcon />
              <p>520</p>
            </div>
            <button className=" p-2 bg-green-400 my-2 mb-8 rounded-sm px-7">
              <NavLink to={"/contestRegister"}>
              Register Now
              </NavLink>
            </button>
          </div>
        </div>

          ))
        }

      </div>
    </>
  );
}
